import ProductCard from "./ProductCard";

type Props = {
    products : Product[];
}

function ProductsList({ products }: Props) {
    return(
       <div className="orders-list-container">
           <div className="order-list-items">
               <ProductCard />
               
           </div>
       </div>
    )
}
export default ProductsList;
